  `outer_master` tinyint(1) unsigned DEFAULT '0' COMMENT '是否为外部高等级帐号,如果是,则is_inner必须是0外部',
  `creator_id` int(10) unsigned DEFAULT NULL COMMENT '创建者id,内部人员开帐号、外部高等级帐号开低等级帐号时用到',
  `validity_days` int(3) NOT NULL DEFAULT '30' COMMENT '服务有效期限',
