--
-- Table structure for table `param_class`
--

DROP TABLE IF EXISTS `param_class`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `param_class` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '流水编号',
  `vds_id` int(9) unsigned zerofill DEFAULT NULL COMMENT '分类编号',
  `class_name` varchar(20) NOT NULL COMMENT '分类名称',
  `threshold` double DEFAULT '0.5' COMMENT '预设阈值',
  `name_zh_tw` varchar(20) DEFAULT NULL COMMENT '顯示繁体中文名稱',
  `name_zh_cn` varchar(20) NOT NULL COMMENT '簡體中文顯示',
  `name_en_us` varchar(45) NOT NULL COMMENT '顯示英文',
  `model_id` int(11) NOT NULL COMMENT '分类（1:Face,2:Image,3:Text,4:Audio,5:Motion,6:Object,7:Scene）',
  `production_enable` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否产品化，供客户使用, 1使用，0不用',
  `zone` varchar(10) DEFAULT NULL COMMENT '区域，暂不使用',
  `rcnn_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行Object(RCNN)辦識功能，1使用，0不用',
  `cnn_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行Scene(CNN)辦識功能，1使用，0不用',
  `dpm_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行Object(DPM)辦識功能，1使用，0不用',
  `face_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行Face辦識功能，1使用，0不用',
  `ors_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行ORS辦識功能，1使用，0不用',
  `logo_enable` tinyint(11) NOT NULL DEFAULT '1' COMMENT '是否執行Image辦識功能，1使用，0不用',
  `is_complete_class` tinyint(2) NOT NULL DEFAULT '0' COMMENT '资料是否收集完成1:完成，0:没有',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '最近更新时间',
  `hrs_enable` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否进行HRS，1使用，0不用',
  `is_use` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否使用, 1,使用 0,停用',
  PRIMARY KEY (`id`),
  KEY `vds_id` (`vds_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=600080077 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

