  `brand_name_zh_cn` varchar(255) NOT NULL DEFAULT '',
  `brand_name_zh_tw` varchar(255) NOT NULL DEFAULT '',
  `brand_name_en_us` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
